import React, { useState, useEffect } from "react";
import hero from "../assets/hero.jpg";
import salads from "../assets/salads.jpg";
import HeroDesign from "../assets/HeroDesign.png";
import FoodYummy from "../assets/FoodYummy.png";
import product1 from "../assets/product1.jpg";
import product2 from "../assets/product2.jpg";
import product3 from "../assets/product3.jpg";
import product4 from "../assets/product4.jpg";
import drinks from "../assets/drinks.jpg";
import Stack from "@mui/material/Stack";
import Button from "@mui/material/Button";
import { Outlet, Link } from "react-router-dom";
function Order({ setCart }) {
  const [dishes, setDishes] = useState([]);
  const [categories, setCategories] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:8000/api/v1/dish/")
      .then((res) => res.json())
      .then((data) => setDishes(data));
  }, []);

  return (
    <div>
      <div
        className="container"
        style={{
          backgroundColor: "#ffffff",
          opacity: "0.9",
          marginBottom: "50px",
          marginTop: "10px",
        }}
      >
        <div
          class="card bg-light text-white"
          style={{ fontWeight: "bold", color: "#000000" }}
        >
          <nav class="navbar navbar-expand-lg navbar-light bg-light">
            <div class="container-fluid">
              <Link to={"/"} class="navbar-brand">
                <img
                  src={salads}
                  style={{ width: "100px", height: "100px" }}
                  alt="Icon"
                />
                Salads
              </Link>
              <Link to={"/"} class="navbar-brand">
                <img
                  src={product2}
                  style={{ width: "100px", height: "100px" }}
                  alt="Icon"
                />
                Glooten Free
              </Link>
              <Link to={"/"} class="navbar-brand">
                <img
                  src={product4}
                  style={{ width: "100px", height: "100px" }}
                  alt="Icon"
                />
                Deserts
              </Link>
              <Link to={"/"} class="navbar-brand">
                <img
                  src={product1}
                  style={{ width: "100px", height: "100px" }}
                  alt="Icon"
                />
                Meat
              </Link>
              <Link to={"/"} class="navbar-brand">
                <img
                  src={drinks}
                  style={{ width: "100px", height: "100px" }}
                  alt="Icon"
                />
                Drinks
              </Link>
              <div class="collapse navbar-collapse" id="navbarTogglerDemo03">
                <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                  <li class="nav-item" style={{ marginLeft: "50px" }}>
                    <Link to={"/"} class="btn btn-warning" aria-current="page">
                      Go back ‚Ü∫
                    </Link>
                  </li>
                  <li class="nav-item" style={{ marginLeft: "50px" }}>
                    <Link
                      to={"/summary"}
                      class="btn btn-warning"
                      aria-current="page"
                    >
                      My üõí
                    </Link>
                  </li>
                  <li class="nav-item" style={{ marginLeft: "50px" }}>
                    <Link to={"/"} class="btn btn-warning" aria-current="page">
                      Best deals üí∞
                    </Link>
                  </li>
                  <li class="nav-item" style={{ marginLeft: "50px" }}>
                    <Link to={"/"} class="btn btn-warning" aria-current="page">
                      Rate our food üíï
                    </Link>
                  </li>
                </ul>
              </div>
            </div>
          </nav>
        </div>
      </div>
      <div className="container">
        <div className="row row-cols-5 row-cols-md-2 g-4">
          {dishes.map((dish) => (
            <div key={dish.id} className="col">
              <div class="card">
                <img src={dish.imageUrl} class="card-img-top" alt="..." />
                <div class="card-body">
                  <h3 class="card-title">{dish.name}</h3>
                  <div>
                    {dish.isVegeterian ? (
                      <span style={{ width: "100px", height: "100px" }}>
                        üçÉ
                      </span>
                    ) : (
                      " "
                    )}
                  </div>
                  <p class="card-text">{dish.description}</p>
                </div>
                <div class="card-footer">
                  <small
                    style={{
                      color: "red",
                      fontSize: "bold",
                    }}
                  >
                    {dish.price} $
                  </small>
                  <Button onClick={() => setCart("add", dish)}>üõí</Button>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
      <div
        style={{
          position: "relative",
          textAlign: "center",
          border: "solid",
          borderRadius: "9999px",
        }}
      >
        <img
          src={HeroDesign}
          style={{
            position: "relative",
            left: "38%",
          }}
        />
        <h3
          style={{
            position: "relative",
            bottom: "220px",
            textAlign: "center",
            fontFamily: "fantasy",
          }}
        >
          Are you ready to eat?
        </h3>
        <Link to={"/summary"}>
          <Button
            variant="contained"
            color="success"
            style={{
              position: "relative",
              bottom: "180px",
              textAlign: "center",
            }}
          >
            Let's EAT
          </Button>
        </Link>
      </div>
    </div>
  );
}

export default Order;
